objetoCompra:
Contratação de assistente médico legal com os requisitos comprobatórios para a área de perícia médica e medicina ocupacional, visando atender às demandas judiciais do Conselho Regional dos Técnicos Industriais da 1ª Região (CRT-01), em conformidade com a Lei nº 14.133/2021, o Decreto nº 11.878/2024, e demais normas aplicáveis à Administração Pública Federal indireta. Nos termos da comunicação encaminhada pelo Setor Jurídico do CRT-01, datada de 10 de novembro de 2025, há necessidade urgente de contratar profissional devidamente habilitado, com formação compatível com a matéria periciada, preferencialmente nas áreas de Medicina Legal, Medicina do Trabalho, Psiquiatria e Saúde Ocupacional, a fim de garantir o pleno direito de defesa e o atendimento tempestivo às determinações judiciais.
Dessa forma, a contratação fundamenta-se:
No art. 75, inciso VIII, da Lei nº 14.133/2021, que admite a contratação direta em situação emergencial ou de grave e iminente risco que possa comprometer a continuidade das atividades administrativas ou o cumprimento de decisão judicial;
No art. 8º, §1º, inciso VI, do Decreto nº 11.878/2024, que possibilita o credenciamento e contratação direta por inexigibilidade, quando há inviabilidade de competição por notória especialização técnica;
E ainda no princípio da continuidade do serviço público, conforme o art. 11 da Lei nº 14.133/2021, garantindo a atuação institucional adequada em processos judiciais e administrativos.

