Considerando o Art. 2º d a Portaria nº 16/2025, de 23 de janeiro de 2025, que dispõe sobre a Política de Representação Institucional do CRP-06 e dá outras providências:

São tipologias de representações institucionais finalísticas de caráter permanente ou eventual:

Representações em órgãos de controle e participação social das quais o CRP-06 tenha cadeira permanente ou elegível;

Fóruns e Movimentos Sociais devidamente nomeados;

Comitês de Ética em Pesquisa devidamente nomeados;

Entidades da Psicologia devidamente nomeadas;

Audiências Públicas, Congressos, Seminários, Eventos de interesse do CRP-06, reuniões com Instituições Públicas ou Privadas devidamente nomeadas;

Formação técnica e administrativa;

Espaços do Sistema Conselhos de Psicologia devidamente nomeados;

Outras atividades não ordinárias alinhadas ao plano estratégico e relacionadas com as atividades finalísticas devidamente nomeadas e aprovadas pela vice-presidência do CRP-06.

objetoCompra:
Contratação de serviços técnicos especializados de assessoria e consultoria contábil, em caráter continuado, contemplando:
- escrituração contábil completa;
- análise, orientaçâo e revisão de lançamentos contábeis;
- suporte técnico na elaboração de relatórios contábeis e fiscais obrigatórios;
- adequaçáo da gestão contábil aos padrões estabelecidos pela STN, TCU, CGU
e Tribunais de Contas;
- apoio na interpretação e aplicação das normas atualizadas de contabilidade
pública;
- atendimento a diligências e auditorias dos órgãos de controle;
- organização ê controle das rotinas do departamento pessoal, em conformidade
com as normas vigentes;
- organização e controle do acervo patrimonial da Autarquia.

Serviços de Assessoria e Consultoria na área de Gestão Pública, com ênfase em Licitações e Contratos em favor do CRP-21ª:

Analise e Revisão de Editais, Termos de Referências, atas e contratos;
Suporte Técnico em contratações diretas (dispensas e inexigibilidades);
Apoio a implementação da Lei de n° 14.133/2021 e normativos correlatos;
Consultoria na Estrutura de Governança das Contratações Públicas;
Capacitação e Assessoramento Técnico ás equipes de Licitações e Contratos;
Elaboração de Pareceres Técnicos sobre dúvidas jurídicas ou procedimentos;

Contratação de serviços técnicos especializados de assessoria e consultoria jurídica, em caráter continuado, contemplando:
- emissão de pareceres e notas técnicas;
- análise e acompanhamento de processos administrativos e judiciais:
- apoio em licitações, contratos e matérias de pessoal;
- orientação normativa e consultiva para subsidiar decisões administrativas;
- atendimento a diligências e auditorias de órgãos de controle;
- defesa institucional em instâncias administrativas e judiciais.
